import React from 'react';
import gapi from 'gapi-client';
import './App.css';

function App() {

  fetch("https://www.reddit.com/api/v1/authorize?client_id=BmIWdmE0hYrM7Q&response_type=TYPE&state=RANDOM_STRING&redirect_uri=http://locahost:3000/&duration=permanent&scope=read",{
    method: 'GET',
    mode: 'cors',
    redirect: 'follow',
  }).then((response) => {
    console.log(response.result);
  });

  return (
    <div className="App">
    </div>
  );
}

export default App;
